import { darkTheme } from '../theme';
import { AppBar, Toolbar, Container, Box, Typography, Button, IconButton, makeStyles, Link } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles({
    navTabs: {
        flexGrow: "1",
        display: "flex",
        justifyContent: "center",
        alignContent: "center",
    },
  })

const Navbar = () => {
    const classes = useStyles();

    return (
        // center navtabs
        <AppBar position="fixed">
            <Box className={classes.navTabs}>
                <Toolbar>
                    
                    <Container >
                        <Button className={classes.navButton} component={Link} href="#home">
                            <Typography variant="body1">
                                Home
                            </Typography>
                        </Button>
                        <Button className={classes.navButton} component={Link} href="#aboutMe">
                            <Typography variant="body1">
                                About me
                            </Typography></Button>
                    </Container>

                    {/* <IconButton edge="end" aria-label="menu">
                        <MenuIcon />
                    </IconButton> */}
                    
                </Toolbar>
            </Box>
        </AppBar>
    )
}

export default Navbar
